create table tbl_category (
  id varchar(150) primary key not null, 
  code varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  name varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  category_image varchar(100),
  description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


create table tbl_event (
  id varchar(150) primary key not null,
  start_date datetime ,
  end_date datetime ,
  discount float ,
  code varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  name varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  banner LONGTEXT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_product (
  id varchar(150) primary key not null,
  code varchar(1200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  -- name varchar(1200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  -- description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  -- price float,
  createDate datetime,
  category_id varchar(1150) not null,
  event_id varchar(1150)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




create table tbl_user (
  id varchar(150) primary key not null,
  code varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  user_image LONGTEXT,
  fullname varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  username varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  password varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  email varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  phonenumber int(11) NOT NULL,
  address LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  createDate datetime,
  birthDate date,
  gender tinyint(1)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_cart(
  user_id varchar(150) not null,
  cart_id varchar(150) not null
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_cart_detail (
  cart_id varchar(150) not null,
  product_id varchar(150) not null,
  size_id varchar(150) not null,
  quantity int,
  unit_price float ,
  primary key (cart_id, product_id, size_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_status (
  id varchar(150) primary key not null, 
  code varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  name varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_order (
  id varchar(150) primary key not null,
  code varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  user_id varchar(150) not null,
  status_id varchar(150) not null,
  receive_phone varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  receive_address varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  delivery_cost float ,
  payment_id varchar(150) not null,
  description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  createDate datetime
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_order_detail (
  order_id varchar(150) not null,
  product_id varchar(150) not null,
  size_id varchar(150) not null,
  quantity int,
  unit_price float ,
  primary key (order_id, product_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_product_image (
  id varchar(150) primary key not null,
  product_id varchar(150) not null,
  description LONGTEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
  content varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
   main_image TINYINT(1) DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

create table tbl_product_size (
  product_id varchar(150) not null,
  size_id varchar(150) not null,
  quantity int,
  primary key (product_id, size_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

